import React from "react";
import ReactDOM from "react-dom";

import "./App.css";
import Search from "./Search";

function App() {
  return (
    <div className="App">
      <h1>Final lesson week 3</h1>
      <Search />
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
